import React, { useState } from "react";
import line from "../images/line.png";
import { useNavigate } from "react-router-dom";

function SideHeader() {
  const navigate = useNavigate();

  const handleLogout = () => {
    navigate("/");
  };

  const [isDashboardClicked, setIsDashboardClicked] = useState(false);

  const handleDashboardClikced = () => {
    setIsDashboardClicked(true);
  };

  return (
    <div style={{ height: "100%", width: "100%" }}>
      <div style={{ textAlign: "center", color: "#474444", fontWeight: "600" }}>
        <p style={{ marginTop: "4vh", fontSize: "2em" }}>QUIZZIE</p>
        <div style={{ fontSize: "1.4em" }}>
          <p
            onClick={handleDashboardClikced}
            style={{
              marginTop: "24vh",
              height: "5vh",
              width: "18vw",
              paddingTop: "1vh",
              marginLeft: "1vw",
              marginRight: "1vw",
              borderRadius: "10px",
              boxShadow: isDashboardClicked ? "0px 0px 14px 0px #0000001F" : "",
            }}
          >
            Dashboard
          </p>
          <p
            style={{
              marginTop: "6vh",
              height: "5vh",
              width: "10vw",
              paddingTop: "1vh",
              marginLeft: "5vw",
              marginRight: "5vw",
              backgroundColor: "pink",
            }}
          >
            Analytics
          </p>
          <p
            style={{
              marginTop: "6vh",
              height: "5vh",
              width: "10vw",
              paddingTop: "1vh",
              marginLeft: "5vw",
              marginRight: "5vw",
              backgroundColor: "pink",
            }}
          >
            Create Quiz
          </p>
        </div>
        <p style={{ marginTop: "23vh" }}>
          <img src={line} alt="line" />
        </p>
        <p
          onClick={handleLogout}
          style={{
            marginTop: "2vh",
            fontSize: "1.6em",
            marginBottom: "2vh",
            cursor: "pointer",
          }}
        >
          Logout
        </p>
      </div>
    </div>
  );
}

export default SideHeader;
